import { BrowserRouter as Router, Route }from 'react-router-dom';

function Sobre() { 
  return (
    <Router>
      <div>
        <Route path='/about' component={Sobre}>
          <div id='Principais'> 
          ✔️Missão: Proporcionar serviços na área musical, alicerçados na competência, humanização e valorização do ensino de música, ter impacto na comunidade. <br/>

          ✔️Visão: Ser reconhecida no município de Guia Lopes da Laguna e região como referência na área de educação musical. <br/>

          ✔️Valores: Prezamos pelo bom relacionamento entre professores, colaboradores e alunos. Relacionamento transparente, baseado em responsabilidade, respeito e confiança entre as partes. Objetivamos o melhor aprendizado musical, sendo o elo entre o desejo de aprender tocar um instrumento musical e a realização deste sonho, bem como exercer o papel cultural e social da arte alcançando a comunidade. <br/>
          </div>
        </Route>
      </div>
    </Router>
  );
}

export default Sobre;
